import React, { Component } from 'react';
import './position-absoulte.sass';

export default class PositionAbsolute extends Component {
  render() {
    return (
      <div className="position-absolute">
        <h1>absolute</h1>
        <p>生成绝对定位的元素，相对于static定位以外的第一个父元素的定位</p>
      </div>
    );
  }
}
